    - ID: "055a2c41-4d44-4441-b589-b86f39cc64e5"
      Hint: HeroBannerContent
      Value: "<p>A common household pest often found around pets, fleas have narrow bodies which allow them to glide through fur easily. Side to side, they are almost flat, allowing them to stealthily maneuver. Their back legs are well developed, allowing them to jump up to six inches in the air. Their mouths have piercing parts, allowing them to dig into their host and suck blood to sustain themselves. Powered by the insect growth regulator (IGR), (S)-methoprene, the Precor® family of products from Zoëcon® offers a variety of professional flea products that deliver 7 months of protection from flea emergence. Learn more about flea behavior, where to find them and the different ways you can treat for them with the information provided below.</p>"
